// Step 1: Login
_loginPage.default.visit();
_loginPage.default.enterEmail(testData.validUser.email);
_loginPage.default.enterPassword(testData.validUser.password);
_loginPage.default.showPassword();
_loginPage.default.clickSignIn();
// Wait until dashboard visible
cy.contains('Order History', {
  timeout: 20000
}).should('be.visible');
// Step 2: Go to Order Sims page
_orderSimsPage.default.visit();
cy.url().should('include', '/order-sims');
// Step 3: Fill order details
_orderSimsPage.default.enterRetailStoreName(testData.orderSims.storeName);
_orderSimsPage.default.enterDeliveryAddress(testData.orderSims.deliveryAddress);
_orderSimsPage.default.enterNumberOfSims(testData.orderSims.sims);
_orderSimsPage.default.enterMessage(testData.orderSims.message);
// Step 4: Submit order
_orderSimsPage.default.clickOrderSims();
cy.wait(5000); // wait for 5 seconds for popup to appear
// Step 5: Handle popup
_orderSimsPage.default.verifyOrderPopupAndClose();
// Step 6: Navigate to order history
_orderSimsPage.default.goToOrderHistory();
// Step 7: Verify order appears
_orderSimsPage.default.verifyOrderInHistory(testData.orderSims.storeName, testData.orderSims.sims, testData.orderSims.status);
